Node.DataCrLf:
var idProduct='££productSelect££';
var nameProduct=$j(this).attr('name');
var prevNameProduct=nameProduct.split('productSelect')[0];
var afterNameProduct=nameProduct.split('productSelect')[1];

top.ajaxPost("bDoc.Admin.Vaccine.csp",
"action=callMethodForNote"
+"&className=BDOC.Patient.VaccineProductSchema"
+"&classMethod=getAllProductSchemaForProd"
+"&argMethod="+idProduct,
function(data){
$j('select[name='+prevNameProduct+'productSchemaSelect'+afterNameProduct+']').children().remove();
var res=data.data;
var i = 0;
while (res.split(';')[i])
{
idSchema = res.split(';')[i].split('~')[0];
libelSchema = res.split(';')[i].split('~')[1];
if (idSchema!=''){
$j('select[name='+prevNameProduct+'productSchemaSelect'+afterNameProduct+']').append('<option value='+idSchema+'>'+libelSchema+'</option>');
}
i++;	
}
$j('select[name='+prevNameProduct+'productSchemaSelect'+afterNameProduct+']').val('');
},0);

$j('[name='+prevNameProduct+'initHid'+afterNameProduct+']').val('1');
